import React, { Component } from 'react';
import martianlogo from './images/The_Martian_image.jpg';
import BlackMirrorCover from './images/Black_Mirror_cover.jpg';
import BreakingBadCover from './images/Breaking_Bad_cover.jpg';
import DeathNoteCover from './images/Death_Note_cover.jpg';
import GameOfThronesCover from './images/Game_Of_Thrones_cover.jpg';
import TheWireCover from './images/The_Wire_cover.jpg';
import WalkingDeadCover from './images/Walking_Dead_cover.jpg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <img src={martianlogo} alt='The Martian Logo'/>
        <br /><br /><br />
        <div className = "TVShowTitles">
          <div className = "show"> Black Mirror</div>
          <div className = "show"> Breaking Bad</div>
          <div className = "show"> Death Note</div>
        </div>
        <br /><br />
        <div className = "TVShowTitles">
          <div className = "show"> Game of Thrones</div>
          <div className = "show"> The Walking Dead</div>
          <div className = "show"> The Wire</div>
        </div>
      </div>
    );
  }
}

export default App;
